@Test
    public void updateDocumentSection() throws XWikiException
    {
        this.document.setContent(
            "content not in section
" + "= header 1=
header 1 content
" + "== header 2==
header 2 content");
        this.document.setSyntax(Syntax.XWIKI_2_0);

        // Modify section content
        String content1 = this.document.updateDocumentSection(2, "== header 2==
modified header 2 content");

        assertEquals(
            "content not in section

= header 1 =

header 1 content

== header 2 ==

modified header 2 content",
            content1);

        String content2 = this.document.updateDocumentSection(1,
            "= header 1 =

modified also header 1 content

== header 2 ==

header 2 content");

        assertEquals(
            "content not in section

= header 1 =

modified also header 1 content

== header 2 ==

header 2 content",
            content2);

        // Remove a section
        String content3 = this.document.updateDocumentSection(2, "");

        assertEquals("content not in section

= header 1 =

header 1 content", content3);
    }

